import React from 'react';
import {InfoConsumer} from '../Context';
import Info from '../Info';

function Home(){
    return (
        <div className="container">
            <div className="row mt-5">
            <InfoConsumer>
            {data => {
              return data.info.map(item => {
                return <Info key={item.id} item={item} />;
              });
            }}

        </InfoConsumer>
            </div>
        </div>
        );
}
export default Home;
